import React from "react";
import styled from "styled-components";

const ContactUs = () => {
    return (
        <BoxSection>
            <WrapContainer>
                <Header>Contact Us.</Header>
                <WrapperSubmit>
                    <WrapperInput>
                        <input type="text" />
                    </WrapperInput>
                    <WrapperMessage>
                        <input type="text" />
                    </WrapperMessage>
                </WrapperSubmit>
            </WrapContainer>
        </BoxSection>
    );
};

const BoxSection = styled.section`
    position: relative;
    padding: 8vh 0 0;
    margin: 0 0 2rem;
    @media (max-width: 770px) {
        padding-top: 60px;
        margin: 0 0 1rem;
    }
`;
const WrapContainer = styled.div`
    display: flex;
    align-items: center;
    justify-content: space-between;
    flex-direction: column;
    gap: 20px;
    @media (max-width: 576px) {
    }
`;
const Header = styled.div`
    font-size: 56px;
    font-weight: 800;
`;
const WrapperSubmit = styled.div`
    padding: 1rem;
    width: 100%;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
`;
const WrapperInput = styled.div`
    max-width: 650px;
    padding: 1rem;
    border: 1px solid;
    input {
        width: 100%;
    }
`;
const WrapperMessage = styled.div`
    max-width: 650px;
    padding: 1rem;
    border: 1px solid;
    input {
        width: 100%;
    }
`;

export default ContactUs;
